import React from 'react'
import './Gallery.css'

import image1 from "./images/print1.jpg";
import image2 from "./images/print2.jpg";
import image3 from "./images/print3.jpg";
import image4 from "./images/print4.jpg";
import image5 from "./images/foto1.jpg";

let counter = 0


class Gallery extends React.Component {

    timeCounter(){

      document.getElementById("image").innerHTML=counter
      counter+=1;

      document.getElementById("image").style.borderRadius = counter + "px"

      if(counter>=100){
        counter = 0
      }
    }

    componentDidMount() {
    setInterval(this.timeCounter, 1000/30);
    }


    render(){
        return(

          <div>
            <ul>
              <li>
                <img src={image1} id="image"/>
              </li>
              <li>
                <img src={image2}/>
              </li>
              <li>
                <img src={image3}/>
              </li>
              <li>
                <img src={image5}/>
              </li>
              <li>
                <img src={image4}/>
              </li>
            </ul>
          </div>

        )
    }
}

export default Gallery
